import React from 'react'

function PopUpNote (props) {
  const handleNote = (key, event) => props.onPopUpNote(key, event)

  return (
    <div>
      <button
        className='note-btn'
        onClick={event => handleNote(props.item.id, event)}
      >
    Note
      </button>
      {props.item.note }
    </div>
  )
}

export default PopUpNote
